// initial-config-routing.module.ts
import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { WrapperComponent } from './wrapper/wrapper.component';
import { initialConfigGuard } from 'src/app/core/guards/initial-config.guard';


const routes: Routes = [
  {
    path: '',
    component: WrapperComponent, canActivate: [initialConfigGuard],
    children: [
      { path: 'step1', component: Step1Component }, // Ruta para el paso 1
      { path: 'step2', component: Step2Component }, // Ruta para el paso 2
      // Añade rutas adicionales para otros pasos aquí
      { path: '', redirectTo: 'step1', pathMatch: 'full' } // Redirecciona a 'step1' por defecto

    ],
  },
  { path: '**', redirectTo: '', pathMatch: 'full' }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class InitialConfigRoutingModule { }
